syntax = "proto3";
import "google/protobuf/timestamp.proto";

package IOT9_package;
message IOT9_package_message {
    google.protobuf.Timestamp created_at = 1;
    string date = 2;
    int64 entry_id = 3;
    float temperaturec = 4;
    int64 turbidityntu = 5;
    float dissolved_oxygengml = 6;
    float ph = 7;
    float ammoniagml = 8;
    int64 nitrategml = 9;
    float fish_lengthcm = 10;
    float fish_weightg = 11;
}